sap.ui.define(["./BaseController"],function(t){"use strict";return t.extend("com.app.library.controller.UserPage",{onInit:function(){const t=this.getOwnerComponent().getRouter();t.attachRoutePatternMatched(this.onUserDetailsLoad,this)},onUserDetailsLoad:function(t){const{id:o}=t.getParameter("arguments");this.ID=o;const i=this.getView().byId("idUserPage");if(i){i.bindElement(`/Users(${o})`)}else{console.error("Object page not found")}},onProfilePress:function(){this.loadProfileDialog().then(function(t){var o=this.getView().getModel();t.setModel(o);t.bindElement(`/Users(${this.ID})`);t.open()}.bind(this))},loadProfileDialog:async function(){if(!this.oDialogProfile){this.oDialogProfile=await this.loadFragment("Userdetails")}return this.oDialogProfile},onCloseProfile:function(){if(this.oDialogProfile){this.oDialogProfile.close()}},formatPhoneNumber:function(t){if(typeof t==="string"){return t.replace(/,/g,"")}return t},onAllBooksFilterPress:function(t){var o=t.getSource().getParent().getBindingContext().getObject().ID;const i=this.getOwnerComponent().getRouter();i.navTo("RouteallBooksPage",{id:o})},onNotificationFilterPress:async function(){if(!this.notificationDialog){this.notificationDialog=await this.loadFragment("notifications")}this.notificationDialog.open();const t=this.getView().byId("idnotifyDialog");if(t){t.bindElement(`/Users(${this.ID})`)}else{}},onCloseDialog:function(){if(this.notificationDialog.isOpen()){this.notificationDialog.close()}},onLogoutPress:function(){var t=this.getOwnerComponent().getRouter();t.navTo("RouteHomePage",{},true)}})});